Christmas is in full swing on one of my favorite streets in Old Town Alexandria ❤️🎄 Known for its wonderfully decorated homes it’s definitely in the Christmas spirit right now. Tag a friend you’d like to explore this street with! 

📍Captain’s Row, Old Town Alexandria 

@visitalexva #visitALX #christmasvibes #visitvirginia

The Tidal Basin is getting a lot of well-deserved love right now but don't forget about Old Town Alexandria for a bloom-spotting adventure. This shot in particular was taken on Captain's Row, one of my favorite spots to visit, enjoy and photograph. ❣️ 

I geotagged the location in this post in case you want to check it out! 

