If you love pretty, historic homes and great food then Charleston is for you 💕✨ We recently spent a weekend, revisiting the Holy City and checking out some new-to-us restaurants and old, charming streets.

Not featured here but we love staying at the John Rutledge House Inn. It’s in a great location near King St and on Broad St, pet friendly, nearby parking and has tons of little extras that come with your stay. 📍@johnrutledgehouseinn 

A special shout out to @thepinkfiggy and Meredith for making our time in Charleston extra special. 💗💗

